import React from 'react'

const Fetchers = (dataSet: { teamList: any }) => {

    fetch('http://localhost:9091/teaminfo', {
        method: 'GET'})
    .then(res => res.json())
    .then(data => {
        dataSet.teamList = data["Value"]
        console.log(dataSet.teamList)
    })
    console.log(dataSet.teamList)

    return null
}

export default Fetchers
